// src/App.js
import React from 'react';
import Header from './components/header'; // Adjust the path if necessary
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />

      <div className="bottom2">
        <a href="http://localhost:3000/signup">SignUp</a>
        <a href="http://localhost:3003/login">Login</a>
      </div>

      <p className="name">
        <span>
          <img id="ll" src="https://cdn.glitch.global/74966f89-6b4a-4631-ad79-95f11a65e0dd/logo7.jpg?v=1697534616110" alt="Helping Hands Logo"/>
        </span>
        <span className="name1">Explore</span>
        <span className="name2">Epic</span>
        <span className="name1">...</span>
      </p>
    </div>
  );
}

export default App;
